Settings_PDF_Edit_Js("Settings_PDF_Edit7_Js",{},{step7Container:false,advanceFilterInstance:false,init:function(){this.initialize()},getContainer:function(){return this.step7Container},setContainer:function(element){this.step7Container=element;return this},initialize:function(container){if(typeof container==="undefined"){container=jQuery("#pdf_step7")}if(container.is("#pdf_step7")){this.setContainer(container)}else{this.setContainer(jQuery("#pdf_step7"))}},submit:function(){var aDeferred=jQuery.Deferred();var form=this.getContainer();var formData=form.serializeFormData();var progressIndicatorElement=jQuery.progressIndicator({position:"html",blockInfo:{enabled:true}});var saveData=form.serializeFormData();saveData["action"]="Save";saveData["step"]=7;AppConnector.request(saveData).then(function(data){data=JSON.parse(data);if(data.success==true){Settings_Vtiger_Index_Js.showMessage({text:app.vtranslate("JS_PDF_SAVED_SUCCESSFULLY")});AppConnector.request(formData).then(function(data){form.hide();progressIndicatorElement.progressIndicator({mode:"hide"});aDeferred.resolve(data)},function(error,err){app.errorLog(error,err)})}},function(error,err){app.errorLog(error,err)});return aDeferred.promise()},registerCancelStepClickEvent:function(form){jQuery("button.cancelLink",form).on("click",function(){window.history.back()})},registerEvents:function(){var container=this.getContainer();var opts=app.validationEngineOptions;opts["onValidationComplete"]=function(form,valid){return valid};opts["promptPosition"]="bottomRight";container.validationEngine(opts);this.registerCancelStepClickEvent(container);App.Fields.Picklist.showSelect2ElementView(container.find(".select2"))}});